16インチ用泥除け前後セットです。<br>[対応車種]: 16インチ<br>【DAHON(ダホン)とは……】<br><br>ドクターホンによって、1982年に設立された折りたたみ米国に本社を置く自転車専業メーカー。<br><br>オイルショックを機に折り畳み自転車の研究開発を積み重ね、1983年にDAHONのルーツとなる画期的な折り畳み自転車を発表。<br><br>革新的な発明で数々の特許を取得し、幾多の賞を受賞している。<br><br>全世界から折りたたみ自転車のリーディングメーカーとして、その功績を評価されている。※商品色はご覧になるモニターの特性により実物の色と多少異なります。<br><br>※仕様変更により予告なく素材や形状が変更となる場合があります。あらかじめご了承ください。<center><img src="https://image.rakuten.co.jp/vvv/cabinet/category/outdoor16_01.jpg" width="70%" border="0"><br><br>
